import React from "react";
function GrabStatBlock(){
    let statblock = new Map([
        ["str",0],
        ["dex",0],
        ["con",0],
        ["int",0],
        ["wis",0],
        ["cha",0]
      ])
    return statblock
}

export default GrabStatBlock
